import React from "react";
import SideBar from "./sideBarComponent";

const MainBanner = () => {
  return (
    <div>
      <div class="right">
        <div class="side_bar_items">
          <SideBar /> {/* <RotateImage /> */} {/* <Gallery /> */}
        </div>
      </div>
      <div class="image">
        <div class="side_bar_items">
          <SideBar /> {/* <RotateImage /> */} {/* <Gallery /> */}
        </div>
      </div>{" "}
      <div class="left">
        <div class="side_bar_items">
          <SideBar /> {/* <RotateImage /> */} {/* <Gallery /> */}
        </div>
      </div>
    </div>
  );
};
export default MainBanner;
